import React from 'react'
import { Button, Header, Image, Modal } from 'semantic-ui-react'

const AddLeadModal = ({ isAddLeadModalOpen, toggleAddLeadModalOpen }) => {
  console.log('isAddLeadModalOpen--', isAddLeadModalOpen);
  return (
    <Modal
      onClose={() => toggleAddLeadModalOpen(false)}
      onOpen={() => toggleAddLeadModalOpen(true)}
      open={isAddLeadModalOpen}
    >
      <Modal.Header>Add Lead</Modal.Header>
    </Modal>
  )
}

export default AddLeadModal
